import React from "react";
import "./styles/main.css";

function Queue(props) {
  return (
    <aside class="queue">
      <p className="queue__title">NEXT VIDEO</p>
      <div class="queue__video">
        <img class="queue__video--thumb" src="" alt="" />
        <h2 class="queue__video--title"></h2>
        <span class="queue__video--channel"></span>
      </div>
    </aside>
  );
}

export default Queue;
